import React from 'react'
import "./stylesheet/Home.css"



  const Home = () =>
  {
    const handleClick = () =>
    {
      alert( 'Button clicked!' );
    };

    return (
      <>
        <div>
          <p className='title'>Blockchain Medical <br></br>Record System</p>
          <p className='subtitle'>Ensure that your documents are safe!</p>
        </div>

      </>
    )
  }

  export default Home
